import React from "react";
import Sage from "./sage.PNG";
import "./portfolio.css";
function Portfolio() {
  return (
    <div className="projects">
      <div class="container">
        <div class="row align-items-center">
          <div class="col-6">
            <label>SAGE</label>
          </div>
          <div class="col-6">
            <img src={Sage} alt="Project Screenshot" className="img"></img>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Portfolio;
